import React from 'react';
import styled from 'styled-components';

const ExperienceContainer = styled.div``;

const SectionTitle = styled.h2`
  font-size: 2rem;
  color: #2c3e50;
  margin-bottom: 1.5rem;
  border-bottom: 2px solid #eee;
  padding-bottom: 0.5rem;
`;

const ExperienceList = styled.div``;

const ExperienceItem = styled.div`
  margin-bottom: 2rem;
`;

const JobHeader = styled.div`
  display: flex;
  justify-content: space-between;
  margin-bottom: 0.5rem;
`;

const JobTitle = styled.h3`
  color: #34495e;
  margin: 0;
`;

const Company = styled.h4`
  color: #3498db;
  margin: 0.5rem 0;
`;

const DateRange = styled.span`
  color: #7f8c8d;
  font-style: italic;
`;

const Description = styled.p`
  color: #666;
  line-height: 1.6;
`;

const Responsibilities = styled.ul`
  list-style: none;
  padding: 0;
  margin-top: 1rem;
`;

const Responsibility = styled.li`
  margin-bottom: 0.5rem;
  color: #666;
  display: flex;
  align-items: center;
  
  &:before {
    content: "•";
    color: #3498db;
    margin-right: 0.5rem;
  }
`;

function Experience() {
  return (
    <ExperienceContainer>
      <SectionTitle>Work Experience</SectionTitle>
      <ExperienceList>
        <ExperienceItem>
          <JobHeader>
            <JobTitle>Senior Software Developer</JobTitle>
            <DateRange>2020 - Present</DateRange>
          </JobHeader>
          <Company>Tech Company Inc.</Company>
          <Description>
            Leading development team in creating innovative web applications using modern technologies.
          </Description>
          <Responsibilities>
            <Responsibility>Developed and maintained React-based web applications</Responsibility>
            <Responsibility>Implemented responsive designs and optimized performance</Responsibility>
            <Responsibility>Mentored junior developers and conducted code reviews</Responsibility>
            <Responsibility>Collaborated with cross-functional teams to deliver high-quality products</Responsibility>
          </Responsibilities>
        </ExperienceItem>

        <ExperienceItem>
          <JobHeader>
            <JobTitle>Software Developer</JobTitle>
            <DateRange>2018 - 2020</DateRange>
          </JobHeader>
          <Company>Digital Solutions Ltd.</Company>
          <Description>
            Contributed to the development of enterprise-level web applications.
          </Description>
          <Responsibilities>
            <Responsibility>Built user interfaces using React and Redux</Responsibility>
            <Responsibility>Integrated RESTful APIs and third-party services</Responsibility>
            <Responsibility>Implemented automated testing and CI/CD pipelines</Responsibility>
            <Responsibility>Participated in agile development processes</Responsibility>
          </Responsibilities>
        </ExperienceItem>
      </ExperienceList>
    </ExperienceContainer>
  );
}

export default Experience;
